      SELECT DISTINCT + col1 + - col0 * cor0.col2 + - ( - 89 * col0 + - col0 * + col0 ) AS col2 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q7330.out
    data: |
      2006
      4402
      8635
